import { Tabs, Layout } from "antd";
const {  Content } = Layout;
function DsNhaBan() {
  return(
    <Layout>
      <Content>
      <Row>
      <Col flex="100px">100px</Col>
      <Col flex="auto">Fill Rest</Col>
    </Row>
      </Content>
    </Layout>
  )
}

export default DsNhaBan;
